CREATE TABLE IF NOT EXISTS `area` (
  `id` INT(11) NOT NULL COMMENT 'id',
  `pid` INT(11) NOT NULL COMMENT '父级id',
  `name` VARCHAR(50) DEFAULT '' COMMENT '名称',
  `shortname` VARCHAR(40) DEFAULT '' COMMENT '简称',
  `longitude` DOUBLE(12,6) DEFAULT '0.000000' COMMENT '中心经度',
  `latitude` DOUBLE(12,6) DEFAULT '0.000000' COMMENT '中心纬度',
  `level` SMALLINT(6) DEFAULT '0' COMMENT '级别，1：省份，2：城市，3：县/区，4：乡镇/街道办',
  `sort` MEDIUMINT(9) DEFAULT '0' COMMENT '排序',
  `status` TINYINT(4) DEFAULT '1' COMMENT '状态1有效',
  PRIMARY KEY (`id`),
  KEY `pid` (`pid`),
  KEY `IDX_position` (`longitude`,`latitude`),
  KEY `IDX_level` (`level`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT '地区表';

